import React, { useEffect, useState } from "react";
import axios from "axios";
import DashboardLayout from "../components/DashboardLayout";
import AddSchoolModal from "../components/AddSchoolModal";
import EditSchoolModal from "../components/EditSchoolModal";
import BulkSchoolUploadModal from "../components/BulkSchoolUploadModal";
import AddPlayerModal from "../components/AddPlayerModal";
import EditPlayerModal from "../components/EditPlayerModal";
import ViewPlayerModal from "../components/ViewPlayerModal";
import BulkPlayerUploadModal from "../components/BulkPlayerUploadModal";
import ChangeAdminPasswordModal from "../components/ChangeAdminPasswordModal";

export default function AdminDashboard() {
  // State variables
  const [schools, setSchools] = useState([]);
  const [players, setPlayers] = useState([]);
  const [view, setView] = useState("schools");
  const [loading, setLoading] = useState(true);
  const [stats, setStats] = useState({ schools: 0, players: 0 });
  const [err, setErr] = useState("");
  const [changePwdSchool, setChangePwdSchool] = useState(null);

  // Modals/UI state
  const [addSchoolOpen, setAddSchoolOpen] = useState(false);
  const [bulkSchoolOpen, setBulkSchoolOpen] = useState(false);
  const [editSchool, setEditSchool] = useState(null);

  const [addPlayerOpen, setAddPlayerOpen] = useState(false);
  const [editPlayer, setEditPlayer] = useState(null);
  const [viewPlayer, setViewPlayer] = useState(null);

  const [bulkPlayerOpen, setBulkPlayerOpen] = useState(false);
  const [selectedSchoolId, setSelectedSchoolId] = useState(""); // For super admin

  // For bulk player delete
  const [selectedPlayerIds, setSelectedPlayerIds] = useState([]);

  const token = localStorage.getItem("token");
  const user = JSON.parse(localStorage.getItem("user") || "{}");

  // Fetch schools and players on mount or token change
  useEffect(() => {
    const fetchData = async () => {
      setLoading(true);
      setErr("");
      try {
        console.log("Fetching schools and players..."); // Log when fetching starts
        // Fetch schools and players data concurrently
        const [schoolsRes, playersRes] = await Promise.all([
          axios.get("http://localhost:5000/api/schools", {
            headers: { Authorization: `Bearer ${token}` },
          }),
          axios.get(
            `http://localhost:5000/api/players${
              user.role === "super_admin" && selectedSchoolId
                ? `?school_id=${selectedSchoolId}`
                : ""
            }`,
            { headers: { Authorization: `Bearer ${token}` } }
          ),
        ]);

        console.log("Schools Response:", schoolsRes.data); // Log response for schools
        console.log("Players Response:", playersRes.data); // Log response for players

        setSchools(schoolsRes.data.schools || []);
        setPlayers(playersRes.data.players || []);

        // Calculate platform stats
        const playerCount =
          playersRes.data.pagination?.total ??
          playersRes.data.players?.length ??
          0;

        setStats({
          schools: schoolsRes.data.schools?.length || 0,
          players: playerCount,
        });

        setSelectedPlayerIds([]);
      } catch (error) {
        console.error("Error fetching data:", error); // Log any error while fetching
        setErr(error?.response?.data?.message || "Error loading data.");
      }
      setLoading(false);
    };

    fetchData();
    // eslint-disable-next-line
  }, [token, selectedSchoolId, view]);

  // Reload helpers
  const reloadPlayers = async () => {
    try {
      console.log("Reloading players..."); // Log when players are reloaded
      const res = await axios.get(
        `http://localhost:5000/api/players${
          user.role === "super_admin" && selectedSchoolId
            ? `?school_id=${selectedSchoolId}`
            : ""
        }`,
        { headers: { Authorization: `Bearer ${token}` } }
      );
      console.log("Players Reloaded:", res.data.players); // Log reloaded players
      setPlayers(res.data.players || []);
      setSelectedPlayerIds([]);
      setStats((prev) => ({
        ...prev,
        players:
          res.data.pagination?.total ??
          res.data.players?.length ??
          prev.players,
      }));
    } catch (error) {
      setErr("Error reloading players.");
    }
  };

  const reloadSchools = async () => {
    try {
      console.log("Reloading schools..."); // Log when schools are reloaded
      const res = await axios.get("http://localhost:5000/api/schools", {
        headers: { Authorization: `Bearer ${token}` },
      });
      console.log("Schools Reloaded:", res.data.schools); // Log reloaded schools
      setSchools(res.data.schools || []);
    } catch (error) {
      setErr("Error reloading schools.");
    }
  };

  // Delete handlers
  const handleDeleteSchool = async (id) => {
    console.log(`Deleting school with ID: ${id}`); // Log the school being deleted
    if (!window.confirm("Are you sure you want to delete this school?")) return;
    try {
      await axios.delete(`http://localhost:5000/api/schools/${id}`, {
        headers: { Authorization: `Bearer ${token}` },
      });
      reloadSchools();
    } catch (error) {
      alert(error?.response?.data?.message || "Delete failed.");
    }
  };

  const handleDeletePlayer = async (id) => {
    console.log(`Deleting player with ID: ${id}`); // Log the player being deleted
    if (!window.confirm("Are you sure you want to delete this player?")) return;
    try {
      await axios.delete(`http://localhost:5000/api/players/${id}`, {
        headers: { Authorization: `Bearer ${token}` },
      });
      reloadPlayers();
    } catch (error) {
      alert(error?.response?.data?.message || "Delete failed.");
    }
  };

  // BULK DELETE players
  const handleBulkDeletePlayers = async () => {
    console.log(`Deleting selected players: ${selectedPlayerIds}`); // Log the selected players being deleted
    if (
      selectedPlayerIds.length === 0 ||
      !window.confirm("Delete selected players?")
    )
      return;
    try {
      await axios.post(
        "http://localhost:5000/api/players/bulk-delete",
        { ids: selectedPlayerIds },
        { headers: { Authorization: `Bearer ${token}` } }
      );
      reloadPlayers();
    } catch (error) {
      alert(error?.response?.data?.message || "Bulk delete failed.");
    }
  };

  // Sidebar links for navigation
  const sidebarLinks = [
    { label: "Schools", icon: "🏫", onClick: () => setView("schools"), active: view === "schools" },
    { label: "Players", icon: "🧑‍🎓", onClick: () => setView("players"), active: view === "players" },
    { label: "Platform Stats", icon: "📊", onClick: () => setView("stats"), active: view === "stats" },
  ];

  // Handle change admin password
  const handleOpenPwdChange = (school) => setChangePwdSchool(school);

  // Checkbox selection logic for players
  const togglePlayerSelection = (id) => {
    console.log(`Toggling player selection for player ID: ${id}`); // Log player selection toggle
    setSelectedPlayerIds((prev) =>
      prev.includes(id) ? prev.filter((pid) => pid !== id) : [...prev, id]
    );
  };

  const handleSelectAllPlayers = (e) => {
    console.log(`Select all players: ${e.target.checked}`); // Log select all players action
    if (e.target.checked) {
      setSelectedPlayerIds(players.map((p) => p.id));
    } else {
      setSelectedPlayerIds([]);
    }
  };

  return (
    <DashboardLayout user={user} onLogout={() => {
      localStorage.removeItem("token");
      localStorage.removeItem("user");
      window.location.href = "/login";
    }} sidebarLinks={sidebarLinks}>
      <div className="flex flex-col gap-6 w-full">
        <h1 className="text-3xl font-extrabold text-athletiq-navy mb-2">Super Admin Dashboard</h1>
        {err && <div className="text-red-500 mb-4">{err}</div>}
        {loading ? (
          <div>Loading...</div>
        ) : (
          <>
            {/* -------- Schools View -------- */}
            {view === "schools" && (
              <div>
                {/* Schools table and modals go here */}
              </div>
            )}

            {/* -------- Players View -------- */}
            {view === "players" && (
              <div>
                {/* Players table and modals go here */}
              </div>
            )}

            {/* -------- Stats View -------- */}
            {view === "stats" && (
              <div>
                <h2 className="text-xl font-bold text-athletiq-navy mb-4">Platform Stats</h2>
                <div className="flex gap-8">
                  <div className="bg-athletiq-blue px-6 py-4 rounded text-center shadow text-white">
                    <div className="text-3xl font-bold">{stats.schools}</div>
                    <div>Schools</div>
                  </div>
                  <div className="bg-athletiq-green px-6 py-4 rounded text-center shadow text-white">
                    <div className="text-3xl font-bold">{stats.players}</div>
                    <div>Players</div>
                  </div>
                </div>
              </div>
            )}
          </>
        )}
      </div>
    </DashboardLayout>
  );
}
